import React, { FC } from "react";
import Layout from "../components/common/Layout";

const Fallback: FC = () => {
  return (
    <Layout title="페이지를 찾을 수 없습니다">
      <div style={{ marginTop: 100, background: "black" }}>
        <h1>test</h1>
      </div>
    </Layout>
  );
};

export default Fallback;
